","code_location_mapping$combined_label <- paste(code_location_mapping$location_code, code_location_mapping$truncated_address, sep = \" - \")\n","                                                \n","# Plotting the stacked bar graph with numeric codes and location names in the legend\n","LocationSentiment <- ggplot(McSentimentLocation, aes(x = as.factor(location_code), y = score, fill = as.factor(location_code))) +\n","  geom_bar(stat = \"identity\", position = \"stack\", color = \"black\") +\n","  scale_fill_manual(values = rainbow(length(unique(McSentimentLocation$truncated_address))),\n","                    breaks = unique(McSentimentLocation$location_code),\n","                    labels = code_location_mapping$combined_label) +\n","  theme_minimal() +\n","  labs(title = \"Sentiment Scores for McDonald's Store Locations (US)\",\n","       x = \"Location Code\",  # Modify x-axis label\n","       y = \"Sentiment Score\") +\n","  theme(axis.text.x = element_text(angle = 60, hjust = 1),\n","        axis.title.x = element_text(size = 10))\n","\n","LocationSentiment\n","ggsave(\"LocationSentiment.png\", plot = LocationSentiment)  \n"]},{"cell_type":"markdown","id":"54b16a67","metadata":{"papermill":{"duration":0.026837,"end_time":"2023-12-26T20:38:26.3377","exception":false,"start_time":"2023-12-26T20:38:26.310863","status":"completed"},"tags":[]},"source":["# 8 - Plotting the sentiment scores in the map"]},{"cell_type":"code","execution_count":17,"id":"a8e4774b","metadata":{"execution":{"iopub.execute_input":"2023-12-26T20:38:26.393643Z","iopub.status.busy":"2023-12-26T20:38:26.391971Z","iopub.status.idle":"2023-12-26T20:38:27.351639Z","shell.execute_reply":"2023-12-26T20:38:27.349629Z"},"papermill":{"duration":0.9918,"end_time":"2023-12-26T20:38:27.355343","exception":false,"start_time":"2023-12-26T20:38:26.363543","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd