els = c(\"Negative\", \"Positive\"),\n","                     name = \"Sentiment\") +\n","  coord_fixed() +\n","  labs(title = \"Sentiment Score in McDonald's Locations of USA\",\n","       size = \"Sentiment Score\")\n","\n","print(McSentimentMap)"]},{"cell_type":"markdown","id":"fd11c3a1","metadata":{"papermill":{"duration":0.027983,"end_time":"2023-12-26T20:38:27.412747","exception":false,"start_time":"2023-12-26T20:38:27.384764","status":"completed"},"tags":[]},"source":["# Conclusion\n","* The customers are actively speaking on the McDonald's experience as per the word cloud.\n","* The overall sentiment analysis provides a slightly positive sentiment score of 0.058.\n","* Client reviews for store 10 (1415 E State Rd, Fern Park) shows the highest positive sentiment score.\n","* Comparatively, store 14 (1650 Washington Ave, Miami Beach) shows the higest negative sentiment score.\n","* 28/40 stores are showing positive sentiment scores, which indicates good client satisfaction, while indicating room for possible improvements for those with negative scores.\n","* It is interesting to note that the negative sentiment score reported is way lower than the positive sentiment score reported on the scale."]},{"cell_type":"markdown","id":"bb5638df","metadata":{"papermill":{"duration":0.02763,"end_time":"2023-12-26T20:38:27.468869","exception":false,"start_time":"2023-12-26T20:38:27.441239","status":"completed"},"tags":[]},"source":["# References\n","\n","Dataset:\n","Elgiriyewithana, N. (2023) ‘McDonald’s Store Reviews’. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3422393,"sourceId":5968827,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"paper